import "./style.css";
import { Feature, Map, View } from "ol";
import TileLayer from "ol/layer/Tile";
import OSM from "ol/source/OSM";
import Point from "ol/geom/Point";
import Style from "ol/style/Style";
import Icon from "ol/style/Icon";
import VectorLayer from "ol/layer/Vector";
import VectorSource from "ol/source/Vector";
import LinearRing from "ol/geom/LinearRing";
import Fill from "ol/style/Fill";
import ImageStatic from "ol/source/ImageStatic";
import VectorImageLayer from "ol/layer/VectorImage";
import Polygon from "ol/geom/Polygon";
import MultiPolygon from "ol/geom/MultiPolygon";
import Image from "ol/layer/Image";
import Projection from "ol/proj/Projection";

//佐渡島を囲む座標
const coordinates = [
  // 経度、緯度の順で定義
  [138.247243, 38.317245],
  [138.184912, 38.173751],
  [138.0778591227916, 37.830986409949396],
  [138.3828797139343, 37.74678185645601],
  [138.9284682246435, 38.07523995472225],
  [138.3828797139343, 38.77523995472225],
  [138.247243, 38.317245],
];

//適当な図形
const coordinates2 = [
  // 経度、緯度の順で定義
  [138.247243, 38.317245],
  [138.184912, 38.173751],
  [138.0778591227916, 37.830986409949396],
  [138.3828797139343, 37.74678185645601],
  [138.9284682246435, 38.07523995472225],
  [138.3828797139343, 38.77523995472225],
  [138.247243, 38.317245],
];
const polyFeature = new Feature({
  geometry: new Polygon([coordinates]),
});

const polyFeature2 = new Feature({
  geometry: new Polygon([coordinates2]),
});

const imageFeature = new Feature({
  geometry: new Polygon([coordinates]),
});

//webメルカルトへ変換
polyFeature.getGeometry().transform("EPSG:4326", "EPSG:3857");
polyFeature2.getGeometry().transform("EPSG:4326", "EPSG:3857");
imageFeature.getGeometry().transform("EPSG:4326", "EPSG:3857");

//
const styles = new Style({
  fill: new Fill({
    color: "rgba(0,5,255,0.3)",
  }),
});

const vectorLayer = new VectorLayer({
  source: new VectorSource({
    features: [polyFeature, polyFeature2],
  }),
  style: styles,
});
polyFeature2.setStyle(
  new Style({
    fill: new Fill({
      color: "rgba(0,0,5,0.2)",
    }),
  })
);

const imageLayer = new Image({
  source: new ImageStatic({
    url: "data:image/png;base64,",
    imageExtent: imageFeature.getGeometry().getCoordinates()[0][0],
    projection: new Projection({
      code: "xkcd-image",
      units: "pixel",
      extent: imageFeature.getGeometry().getCoordinates()[0][0],
    }),
  }),
  extent: imageFeature.getGeometry().getCoordinates()[0][0],
});

const map = new Map({
  target: "map",
  layers: [
    new TileLayer({
      source: new OSM(),
    }),
    vectorLayer,
    imageLayer,
  ],
  view: new View({
    center: [0, 0],
    zoom: 4,
  }),
});

map.on("click", (e) => {
  map.forEachFeatureAtPixel(e.pixel, (feature, layer) => {
    console.log(feature);
  });
});
